import React from "react";
import { Swiper, SwiperSlide } from 'swiper/react';

const Home = () => {
    return (
        <div className="home bg-color-2 ">
            <div className="container">
                <div className="row">
                    <div className="col">
                        <Swiper
                            spaceBetween={0}
                            slidesPerView={2}
                            onSlideChange={() => console.log('slide change')}
                            onSwiper={(swiper) => console.log(swiper)}
                        >
                            <SwiperSlide>
                                <img src="https://cdn3009.cdn-template-4s.com/media/banner/slide-2.webp"/>
                            </SwiperSlide>
                            <SwiperSlide>
                                <img src="https://cdn3009.cdn-template-4s.com/media/banner/slide-1.webp"/>
                            </SwiperSlide>
                        </Swiper>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Home
